const Nav = () => {
    return (
        <div className="nav-bar">
            <ul>
                <li>Home</li>
                <li>Explore</li>
                <li>About</li>
                <li>Gallery</li>
            </ul>
            <a href=""><button id="login" className="button">Account</button></a>
        </div>
    )
}

export default Nav;
